import React from 'react';
import ProjectImage from './ProjectImage.js';

function DentalDeserts(props) {
    return (
        <div>
          <h1>DentalDeserts</h1>
          <ProjectImage
        link="/DentalDeserts"
        image="./DentalDeserts.gif"
        title="Dental Deserts in US"
        category="Web App"
        />
        </div>
      )
}



export default DentalDeserts;
